import logo from "./layrlabs.png";
import "./App.css";
import { Image, Navbar, Tab, Tabs, Container, Col, Row, InputGroup, FormControl, DropdownButton, Dropdown, Button, ButtonGroup } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';

const openInNewTab = (url) => {
  const newWindow = window.open(url, '_blank', 'noopener,noreferrer')
  if (newWindow) newWindow.opener = null
}


function App() {




  return (
    <div className="App">


      <Navbar className="Navbar" bg="#025fa2" variant="dark">
        <Container>
          <Navbar.Brand href="#home">
            <img
              alt=""
              src={logo}
              width="400"
              height="100"
              className="d-inline-block align-top"
            />{' '}
          </Navbar.Brand>
        </Container>
      </Navbar>

      <header className="App-header">

        <Container>
          <Row>
            <Col></Col>
            <Col xs={15}>






              <Row xs={10} md={10}>
                <Button><img src="./layrswap.png" alt="swap" onClick={() => openInNewTab('http://18.223.121.155:30000/#/swap')}
                /></Button>
              </Row>
              <div style={{ height: 25 }}></div>
              <Row>
                <Image src="./layrbridge.png" fluid />
              </Row>
              <div style={{ height: 25 }}></div>
              <Row>
                <Image src="./layrlogs.png" fluid />
              </Row>
              <div style={{ height: 25 }}></div>
              <Row>
                <Image src="./cardanotest.png" fluid />
              </Row>
              <div style={{ height: 25 }}></div>

            </Col>
            <Col></Col>
          </Row>
        </Container>


      </header>
    </div>
  );
}




export default App;
